const Intro = () => {
  return (
    <section className="intro">
      <div className="clouds">
        <span className="clouds" style={{ "--i": 11 }}></span>

        <span className="clouds" style={{ "--i": 12 }}></span>

        <span className="clouds" style={{ "--i": 24 }}></span>

        <span className="clouds" style={{ "--i": 10 }}></span>

        <span className="clouds" style={{ "--i": 23 }}></span>

        <span className="clouds" style={{ "--i": 18 }}></span>

        <span className="clouds" style={{ "--i": 16 }}></span>

        <div className="intro-heading">
          <h1>Hi, I'm Yusuf.</h1>
          <h3>A software developer by day, superhero by night*</h3>
          <p></p>
        </div>
      </div>
    </section>
  );
};

export default Intro;
